import React from 'react';

const Skills: React.FC = () => (
    <section id="skills">
        <h2>Skills</h2>
        <ul>
            <li><strong>Languages:</strong> Java, C, Python</li>
            <li><strong>Web Technology:</strong> ReactJs, ExpressJs, NodeJs, JavaScript, MongoDB, SQL, Firebase</li>
            <li><strong>CS Fundamentals:</strong> Data Structures and Algorithms, OOPS, OS, DBMS</li>
            <li><strong>Developer Tools:</strong> Git, GitHub, VS Code, Postman, Vercel</li>
        </ul>
    </section>
);

export default Skills;
